  `namedId` varchar(50) NOT NULL,
  `content` text NOT NULL,
  `contentParsed` text NOT NULL,
  PRIMARY KEY  (`namedId`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

/*Data for the table `textedit` */

insert  into `textedit`(`namedId`,`content`,`contentParsed`) values ('contact','If you have business inquires or other questions, please fill out the following form to contact us. Thank you.','<p>If you have business inquires or other questions, please fill out the following form to contact us. Thank you.</p>\n'),('footer','Not really copyrighted, but if it was, I would write that here\n<br />\nPowered by <a href=\"http://www.yiiframework.com/\">Yii Framework</a>.','<p>Not really copyrighted, but if it was, I would write that here\n<br />\nPowered by <a href=\"http://www.yiiframework.com/\">Yii Framework</a>.</p>\n'),('home1','*Note:* Usually requires nightly build of Yii\n\n### Features:\n\n* User management\n     1. Login/logout\n     2. Registration\n     3. Email verification\n     4. Administrative functions\n     5. User list (using Ajax pagination)\n     6. User recovery\n* User groups\n     1. Group authorization \n* Extensions\n     1. Email\n     2. Time Helper\n     3. Logable Behavior\n     4. Parse Cache Behavior\n     5. AutoTimestampBehavior\n     6. TextEdit module\n* Extended access control (or rather simplified)\n* Contact page\n* Logging and clean urls configured \n\n### Checklist for installing:\n\n* Edit paths in `index.php` as necessary\n* Set up database in the `main.php` config file\n* Run sql in the `protected/config/tables.sql`\n* Optionally load mysql test data in `protected/config/`\n* Login as admin with `username=admin`, `password=admin`\n\n### Links\n* [Yii Forum Thread](http://www.yiiframework.com/forum/index.php/topic,799.0.html)\n* [SVN at Google code](http://code.google.com/p/yii-skeleton-app/)','<p><em>Note:</em> Usually requires nightly build of Yii</p>\n\n<h3>Features:</h3>\n\n<ul>\n<li>User management\n\n<ol>\n<li>Login/logout</li>\n<li>Registration</li>\n<li>Email verification</li>\n<li>Administrative functions</li>\n<li>User list (using Ajax pagination)</li>\n<li>User recovery</li>\n</ol></li>\n<li>User groups\n\n<ol>\n<li>Group authorization </li>\n</ol></li>\n<li>Extensions\n\n<ol>\n<li>Email</li>\n<li>Time Helper</li>\n<li>Logable Behavior</li>\n<li>Parse Cache Behavior</li>\n<li>AutoTimestampBehavior</li>\n<li>TextEdit module</li>\n</ol></li>\n<li>Extended access control (or rather simplified)</li>\n<li>Contact page</li>\n<li>Logging and clean urls configured </li>\n</ul>\n\n<h3>Checklist for installing:</h3>\n\n<ul>\n<li>Edit paths in <code>index.php</code> as necessary</li>\n<li>Set up database in the <code>main.php</code> config file</li>\n<li>Run sql in the <code>protected/config/tables.sql</code></li>\n<li>Optionally load mysql test data in <code>protected/config/</code></li>\n<li>Login as admin with <code>username=admin</code>, <code>password=admin</code></li>\n</ul>\n\n<h3>Links</h3>\n\n<ul>\n<li><a href=\"http://www.yiiframework.com/forum/index.php/topic,799.0.html\">Yii Forum Thread</a></li>\n<li><a href=\"http://code.google.com/p/yii-skeleton-app/\">SVN at Google code</a></li>\n</ul>\n'),('userRecovery','Forgot your username and/or password? Not to worry. Enter the email below that you used to create an account with and press \"submit\" and we will email your login credentials to you.','');

/*Table structure for table `user` */

